import React from 'react'
import styled from 'styled-components'
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import TwitterIcon from '@mui/icons-material/Twitter';
import PinterestIcon from '@mui/icons-material/Pinterest';
import Facebook from '@mui/icons-material/Facebook';

const Container = styled.div`
display:flex;
`;

const Logo = styled.h1`

`;
const SocialContainer = styled.div`
display:flex;
`;
const SocialIcon = styled.div`
width:40px;
height:40px;
border-radius:50%;
color:white;
background-color: #${props=>props.color};
display:flex;
align-items:center;
justify-content:center;
margin:20px;
`;
const Description = styled.p`
margin:20px 0px;
`;


const Center = styled.div`
flex:1;
`;
const Right = styled.div`
flex:1;
`;
const Left = styled.div`
flex:1;
display:flex;
flex-direction:column;
padding:20px;
`;

const Footer = () => {
    return (
        <Container>
            <Left>
                <Logo>Sasindu</Logo>
                <Description>Below, we take a close look at what makes up an effective paragraph and explain how to write one that suits your needs. We also cover some advanced tips. But first, letâ€™s start with the fundamentals. </Description>
                <SocialContainer>
                    <SocialIcon color="3B5999">
                        <Facebook/>
                    </SocialIcon>
                    <SocialIcon color="E4405F">
                        <InstagramIcon/>
                    </SocialIcon>
                    <SocialIcon color="55ACEE">
                        <TwitterIcon/>
                    </SocialIcon>
                    <SocialIcon color="E60023">
                        <PinterestIcon/>
                    </SocialIcon>
                </SocialContainer>
            </Left>
            <Center></Center>
            <Right></Right>
        </Container>
    )
}

export default Footer
